import React, {useState} from "react";
import Footer from "../Footer";

export const Login = (props: { onFormSwitch: (arg0: string) => void; }) => {
    const [email, setEmail] = useState('');
    const [pass, setPass] = useState('');

    const handleSubmit = (e: { preventDefault: () => void; }) => {
        e.preventDefault();
        console.log(email);
    }

    return (
        <main className='login_container'>
            <div className="login_form-wrapper">
                <h2 className='login_header'>Welcome back!</h2>
                <p className='login_subtext'>Sign in and get to it.</p>
                <form className="login_form-wrapper" onSubmit={handleSubmit}>
                    <label htmlFor="email">Email</label>
                    <input className='login-field_email' value={email} onChange={(e) => setEmail(e.target.value)}
                           type="email" placeholder="Email Address" id="email" name="email"/>
                    <label htmlFor="password">Password</label>
                    <input className='login-field_password' value={pass} onChange={(e) => setPass(e.target.value)}
                           type="password" placeholder="Password" id="password" name="password"/>
                    <button className='login-button_submit' type="submit">Sign In</button>
                </form>
                <button className="link-btn" onClick={() => props.onFormSwitch('register')}>Don't have an account?
                    Create one now!
                </button>

            </div>
            <Footer/>
        </main>
    )
}
